    <!-- FUNCTIONS -->
    <script>
        function sortGeoJsonFeatures(geoJson, property) {
            if (geoJson.type !== "FeatureCollection" || !geoJson.features) {
                throw new Error("Invalid GeoJSON object. Ensure it's a FeatureCollection with features.");
            }

            geoJson.features.sort((a, b) => {
                const propA = a.properties[property];
                const propB = b.properties[property];

                // Ensure a stable sort by comparing undefined or null properties
                if (propA === undefined || propA === null) return 1;
                if (propB === undefined || propB === null) return -1;

                return propA > propB ? 1 : propA < propB ? -1 : 0;
            });

            return geoJson;
        }


        // Function to toggle layer visibility
        function toggleLayerVisibility(selectedLayer) {
            layers.forEach(layer => {
                map.setLayoutProperty(
                    layer,
                    'visibility',
                    layer === selectedLayer ? 'visible' : 'none'
                );
            });
        }
    </script>

    <!-- PARSE DATA -->
    <script>
        var geojsons = [
            scenario00,
            scenario11,
            scenario22,
            scenario33
        ];

        // Sort based on attacked first, this attacked linkes are displayed on top
        for (geojson of geojsons) {
            geojson = sortGeoJsonFeatures(geojson, 'attacked');
        }
    </script>


    <!-- MAP -->
    <script>
        // Initialize the MapLibre map
        const map = new maplibregl.Map({
            container: 'map', // ID of the container element
            style: 'https://basemaps.cartocdn.com/gl/positron-gl-style/style.json',
            center: [23.72155, 37.98137],
            zoom: 10
        });

        // Add navigation controls
        map.addControl(new maplibregl.NavigationControl());

        var layers = [];

        // Add the data to the map
        map.on('load', function () {
            geojsons.forEach((geojson, index) => {

                var layerName = `Scanario-${index}${index}`;
                layers.push(layerName)

                // Add Source
                map.addSource(layerName, {
                    type: 'geojson',
                    data: geojson
                });

                // Add layer
                map.addLayer({
                    id: layerName,
                    type: 'line',
                    source: layerName,
                    paint: {
                        'line-color': [
                            'case',
                            ['==', ['get', 'attacked'], 1], // If attacked is 1
                            '#ff5500', // Red
                            '#5555ff'  // Else blue
                        ],
                        'line-width': 4,
                        'line-opacity': 1
                    },
                    layout: {
                        visibility: 'none' // Initially hide all layers
                    }
                });

                // Add layer control
                const controls = document.getElementById('layer-controls');
                const div = document.createElement('div');
                const radio = document.createElement('input');
                radio.type = 'radio';
                radio.name = 'layer-control';
                radio.id = layerName;
                radio.value = layerName;
                radio.checked = index === 0; // Check the first layer by default
                radio.addEventListener('change', (e) => toggleLayerVisibility(e.target.value));

                const label = document.createElement('label');
                label.htmlFor = layerName;
                label.textContent = layerName;

                div.appendChild(radio);
                div.appendChild(label);
                controls.appendChild(div);

                // Add popup with all properties
                map.on('click', layerName, function (e) {
                    const features = map.queryRenderedFeatures(e.point);
                    if (!features.length) {
                        return;
                    }

                    const feature = features[0];
                    const properties = feature.properties;

                    const popup = new maplibregl.Popup({ maxWidth: 'auto' })
                        .setLngLat(e.lngLat)
                        .setHTML(`<pre>${JSON.stringify(properties, null, 2)}</pre>`)
                        .addTo(map);
                });


            }); // End layer import & layer control

            // Zoom to firstlayer bbox, instantly
            const bbox = turf.bbox(geojsons[0]);
            map.fitBounds(bbox, {
                padding: 30,
                duration: 0
            });

            // Activate first layer
            toggleLayerVisibility(layers[0]);

            // Add legend icons
            const legend = document.createElement('div');
            const h3 = document.createElement('h3');
            h3.textContent = 'Legend';
            legend.appendChild(h3);
            const icons = ['<span style="color: #ff5500;">&#9632;</span> Attacked links', '<span style="color: #5555ff;">&#9632;</span> Operating links'];
            icons.forEach(icon => {
                const div = document.createElement('div');
                console.log(div)
                div.innerHTML = icon;
                legend.appendChild(div);
            });

            document.getElementById("layer-controls").append(legend);

        });





    </script>
